import React, { Component } from 'react';
import Customer from './components/Customer'
import logo from './logo.svg';
import './App.css';


class App extends Component {
  render() {
    return (
      <Customer
        id={Customer.id}
        image={Customer.image}
        name={Customer.name}
        birthday={Customer.birthday}
        gender={Customer.gender}
        job={Customer.job}
      />
    );
  }
}

export default App;
